import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ComplicationAVC } from 'src/app/models/ComplicationAVC';
import { AvcService } from 'src/app/services/avc.service';

@Component({
  selector: 'app-avc',
  templateUrl: './avc.component.html',
  styleUrls: ['./avc.component.css']
})
export class AvcComponent {
  complications: ComplicationAVC[] = [new ComplicationAVC()];
  errorMessage: string = '';

  constructor(private AvcService: AvcService) {}

  addComplication() {
    this.complications.push(new ComplicationAVC());
  }

  onSubmit() {
    for (let complication of this.complications) {
      this.AvcService.addavc(complication).subscribe(
        response => {
          console.log('Complication added successfully', response);
          this.errorMessage = '';
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding Complication', error);
          this.errorMessage = error.error.title;
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    }
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }
    .form-container h1, .form-container h2 {
      text-align: center;
      font-weight: bold;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      padding-bottom: 10px;
      display: inline-block;
      margin-bottom: 30px;
    }
    .form-container h1 {
      font-size: 36px;
      color: #2c3e50;
      border-bottom: 3px solid #3498db;
    }
    .form-container h2 {
      font-size: 30px;
      color: #c95355;
      border-bottom: 3px solid #f12349;
    }
    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }
    .form-container form div {
      margin-bottom: 15px;
    }
    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }
    .form-container form input, .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }
    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }
    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }
    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }
    .form-container form select {
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }
    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }
    .radio-group input[type="radio"] {
      margin-right: 5px;
    }
    .radio-group label {
      margin: 0;
    }
    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
    }
    .checkbox-group label {
      display: flex;
      align-items: center;
      gap: 5px;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <h1>Complication de la drepanocytose</h1>
      <div *ngFor="let complication of complications; let i = index">
        <h2>AVC- {{ i + 1 }}</h2>
        <!-- Patient Id -->
        <div>
          <label for="PatientId-{{i}}">Patient Id</label>
          <input type="number" id="PatientId-{{i}}" [(ngModel)]="complication.PatientId" name="PatientId-{{i}}" required>
        </div>

        <!-- Syndrome Thoracique aigu -->
        <div>
          <label>Syndrome Thoracique aigu:</label>
          <div class="radio-group">
            <input type="radio" id="AvcOui-{{i}}" [(ngModel)]="complication.Avc" [value]="true" name="Avc-{{i}}">
            <label for="AvcOui-{{i}}">Oui</label>
            <input type="radio" id="AvcNon-{{i}}" [(ngModel)]="complication.Avc" [value]="false" name="Avc-{{i}}">
            <label for="AvcNon-{{i}}">Non</label>
          </div>
        </div>

        <!-- Nombre -->
        <div *ngIf="complication.Avc">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="complication.Nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="complication.Avc">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="complication.Date" name="Date-{{i}}">
        </div>

        <!-- Symptomatologie -->
        <div class="conditional-fields" *ngIf="complication.Avc">
            <label for="Symptomatologie-{{i}}">Symptomatologie:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="Convulsions-{{i}}" [(ngModel)]="complication.Convulsions" name="Convulsions-{{i}}">
                Convulsions
              </label>
              <label>
                <input type="checkbox" id="TroublesDeLaConscience-{{i}}" [(ngModel)]="complication.TroublesDeLaConscience" name="TroublesDeLaConscience-{{i}}">
                Troubles De La Conscience
              </label>
              <label>
                <input type="checkbox" id="Fievre-{{i}}" [(ngModel)]="complication.Fievre" name="Fievre-{{i}}">
                Fievre
              </label>
              <label>
                <input type="checkbox" id="DeficitMoteur-{{i}}" [(ngModel)]="complication.DeficitMoteur" name="DeficitMoteur-{{i}}">
                Déficit Moteur
              </label>
              <label>
                <input type="checkbox" id="Autre-{{i}}" [(ngModel)]="complication.Autre" name="Autre-{{i}}">
                Autre
              </label>
            </div>
          </div>
          <!-- Preciser autre -->
        <div *ngIf="complication.Avc && complication.Autre">
            <label for="PreciserAutre-{{i}}">Preciser Autre:</label>
            <input type="text" id="PreciserAutre-{{i}}" [(ngModel)]="complication.PreciserAutre" name="PreciserAutre-{{i}}">
          </div>

           <!-- TdmCerebrale -->
        <div *ngIf="complication.Avc">
            <label for="TdmCerebrale-{{i}}">TMD Cérébrale:</label>
            <input type="checkbox" id="TdmCerebrale-{{i}}" [(ngModel)]="complication.TdmCerebrale" name="TdmCerebrale-{{i}}">
          </div>
        <!-- Resultat -->
        <div *ngIf="complication.Avc && complication.TdmCerebrale">
            <label for="Résultat-{{i}}">Résultat:</label>
            <input type="text" id="Résultat-{{i}}" [(ngModel)]="complication.ResultatTdm" name="Résultat-{{i}}">
        </div>
           <!-- Angio IRM cérébrale -->
        <div *ngIf="complication.Avc">
            <label for="AngioIrm-{{i}}">Angio IRM cérébrale:</label>
            <input type="checkbox" id="AngioIrm-{{i}}" [(ngModel)]="complication.AngioIrm" name="AngioIrm-{{i}}">
          </div>
          <!-- Resultat -->
        <div *ngIf="complication.Avc && complication.TdmCerebrale">
            <label for="Résultat-{{i}}">Résultat:</label>
            <input type="text" id="Résultat-{{i}}" [(ngModel)]="complication.ResultatIrm" name="Résultat-{{i}}">
        </div>
        <!-- Lieu hospitalisation -->
        <div *ngIf="complication.Avc">
          <label for="LieuHospitalisation-{{i}}">Lieu Hospitalisation:</label>
          <input type="text" id="LieuHospitalisation-{{i}}" [(ngModel)]="complication.LieuHospitalisation" name="LieuHospitalisation-{{i}}">
        </div>

        <!-- Traitement -->
        <div class="conditional-fields" *ngIf="complication.Avc">
          <label for="Traitement-{{i}}">Traitement:</label>
          <div class="checkbox-group">
            <label>
              <input type="checkbox" id="AntalgiquesPalliesI-{{i}}" [(ngModel)]="complication.AntalgiquesPalliesI" name="AntalgiquesPalliesI-{{i}}">
              Antalgiques pallier I
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIi-{{i}}" [(ngModel)]="complication.AntalgiquePallierIi" name="AntalgiquePallierIi-{{i}}">
              Antalgique pallier II
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIii-{{i}}" [(ngModel)]="complication.AntalgiquePallierIii" name="AntalgiquePallierIii-{{i}}">
              Antalgique pallier III
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="complication.HyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
              Hyperhydratation perso
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="complication.HyperhydratationIv" name="HyperhydratationIv-{{i}}">
              Hyperhydratation IV
            </label>
            <label>
              <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="complication.TransfusionSimple" name="TransfusionSimple-{{i}}">
              Transfusion simple
            </label>
            <label>
              <input type="checkbox" id="EchangeTransfusionnel-{{i}}" [(ngModel)]="complication.EchangeTransfusionnel" name="EchangeTransfusionnel-{{i}}">
              Echange transfusionnel
            </label>
            <label>
                <input type="checkbox" id="AutreTraitement-{{i}}" [(ngModel)]="complication.AutreTraitement" name="AutreTraitement-{{i}}">
                Autre
            </label>
          </div>
        </div>

        <!-- Type Antibiotherapie -->
        <div *ngIf="complication.ThoraciqueAigu">
          <label for="TypeAntibiotherapie-{{i}}">Type Antibiotherapie:</label>
          <input type="text" id="TypeAntibiotherapie-{{i}}" [(ngModel)]="complication.TypeAntibiotherapie" name="TypeAntibiotherapie-{{i}}">
        </div>

        <!-- Duree Antibiotherapie -->
        <div *ngIf="complication.ThoraciqueAigu">
          <label for="DureeAntibiotherapie-{{i}}">Duree Antibiotherapie:</label>
          <input type="number" id="DureeAntibiotherapie-{{i}}" [(ngModel)]="complication.DureeAntibiotherapie" name="DureeAntibiotherapie-{{i}}">
        </div>
      </div>
      <div class="submit-row">
        <input type="button" (click)="addComplication()" value="Ajouter Syndrome Thoracique Aigu">
      </div>
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
